import React from 'react';
import Xmark from './Xmark';
import Omark from './Omark';


const Square = ({id, content, move}) => {
    const createMark = () => {
        console.log(content)
    }

    return(
        <div className='square' id={id} onClick={move}>
            {createMark}
        </div>
    )
}
export default Square;
